    const {idUsuario} = useParams();

    function componentDidMount(){
        const config = {
            headers:{
                Authorization:localStorage.getItem('token')
        }
        
    }
    Api.put("updateUser/"+ idUsuario,config).then(
        res =>{
            console.log(">>>>>erro home>>>>>>>>>>>",res);
        },
        err =>{
            console.log(">>>>>erro home>>>>>>>>>>>",err);
        }
    )
    };
    
        return(
            <div>
